import React from "react";
// import Messages from "./Messages";
import Avatar from "react-avatar";
import "./doubt.css";

function Doubt() {
  return (
    <div className="doubt">
      <div className="client">
        <Avatar name={"anupraj"} size={20} round="50px" />
        <span className="userName"> {"anupraj"} </span>
      </div>
      <span className="doubt_text">{"hii"}</span>
    </div>
  );
}

export default Doubt;
